import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets
import java.time.Instant
import java.time.ZoneOffset
import java.time.format.DateTimeFormatter

def flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->

    // Read incoming JSON content
    def jsonText = inputStream.getText('UTF-8')
    def data = new JsonSlurper().parseText(jsonText)

    def transformed = []
    def formatter = DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm:ss").withZone(ZoneOffset.UTC)
    def now = Instant.now()

    data.each { record ->
        def hourMillis = record.startTime
        def startTime = Instant.ofEpochMilli(hourMillis)
        def endTime = startTime.plusSeconds(3600) // +1 hour

        record.stats.each { stat ->
            def entrySum = stat.entryStats?.sum ?: 0
            def locationId = stat.locationid

            transformed << [
                hour        : formatter.format(startTime),   // store readable hour
                entry_sum   : entrySum,
                location_id : locationId,
                start_time  : formatter.format(startTime),
                end_time    : formatter.format(endTime),
                created_at  : formatter.format(now)
            ]
        }
    }

    // Output transformed JSON
    outputStream.write(JsonOutput.prettyPrint(JsonOutput.toJson(transformed))
        .getBytes(StandardCharsets.UTF_8))

} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)
